script: |
  super -f tsv -I q10999.sql | sort > q10999.out

vector: true

inputs:
  - name: q10999.sql
    data: |
      SELECT - ( - COUNT ( * ) ) AS col2 FROM tab1 AS cor0 WHERE col0 NOT BETWEEN + + 4 / - ( + + col2 ) AND + ( + ( + - col0 ) );
  - name: tab1

outputs:
  - name: q10999.out
    data: |
      3
